svg.script:
(function(){
  // --- ID prefixes that belong to interactive shapes ---
  var PREFIXES = ['JO-GROUND-','JO-GROUNDVO-','JO-GROUNDO-','DT-','DT-V-','SF-S','JN-L2-','JN-V-'];

  function matchesPrefix(id){
    for (var i=0; i<PREFIXES.length; i++){
      if (id.indexOf(PREFIXES[i]) === 0) return true;
    }
    return false;
  }

  function slugify(id){
    return 'booth-' + (id || '').toLowerCase().replace(/[^a-z0-9-]+/g, '-').replace(/-+/g,'-').replace(/^-|-$/g,'');
  }

  // --- Color map (category x status) using Anna's hex palette ---
  var COLOR_MAP = {
    dark_blue:   { available: '#0099ff', partial: '#66ccff', full: '#99ccff' },
    green:       { available: '#669933', partial: '#99cc66', full: '#ccff99' },
    lavender:    { available: '#6666cc', partial: '#9999ff', full: '#ccccff' },
    light_blue:  { available: '#66cccc', partial: '#99ffff', full: '#ccffff' },
    orange:      { available: '#ff6600', partial: '#ff9933', full: '#ffcc99' },
    pink:        { available: '#ff3399', partial: '#ff99cc', full: '#ffcccc' },
    red:         { available: '#cc0000', partial: '#ff6666', full: '#ff9999' },
    inactive:    { available: '#999999', partial: '#999999', full: '#999999' }
  };

  function colorFor(category, status){
    var cat = (category || '').toLowerCase().replace(/\s+/g,'_');
    var st = (status || 'available').toLowerCase();
    if (!COLOR_MAP[cat]) cat = 'inactive';
    if (!COLOR_MAP[cat][st]) st = 'available';
    return COLOR_MAP[cat][st];
  }

  function hydratePalette(cfg){
    if (!cfg || !cfg.palette) return;
    try {
      var palette = cfg.palette;
      Object.keys(palette).forEach(function(statusKey){
        var status = (statusKey || '').toLowerCase();
        var byCategory = palette[statusKey] || {};
        Object.keys(byCategory).forEach(function(catKey){
          var cat = (catKey || '').toLowerCase().replace(/\s+/g,'_');
          if (!COLOR_MAP[cat]) COLOR_MAP[cat] = {};
          COLOR_MAP[cat][status] = byCategory[catKey];
        });
      });
    } catch(e){}
  }

  function getBoothMap(cfg){
    if (!cfg) return null;
    if (cfg.booths && typeof cfg.booths === 'object') return cfg.booths;
    if (cfg.data && cfg.data.booths && typeof cfg.data.booths === 'object') return cfg.data.booths;
    return cfg;
  }

  // --- Config loader: tries parent-provided object first, then URL fetch ---
  // Squarespace Code Block will set either:
  //   window.VOID_MAP_CONFIG = {...}
  //   window.MAP_CONFIG_URL = '/s/void_map_configv2.json'
  function loadConfig(done){
    try {
      if (window.VOID_MAP_CONFIG && typeof window.VOID_MAP_CONFIG === 'object') {
        return done(null, window.VOID_MAP_CONFIG);
      }
    } catch(e){}
    try {
      if (window.parent && window.parent.VOID_MAP_CONFIG) {
        return done(null, window.parent.VOID_MAP_CONFIG);
      }
    } catch(e){}
    var url = null;
    try { url = window.MAP_CONFIG_URL || (window.parent ? window.parent.MAP_CONFIG_URL : null); } catch(e){}
    if (!url) return done(new Error('No config present'));
    try {
      fetch(url, {cache: 'no-cache'})
        .then(function(r){ return r.json(); })
        .then(function(json){ done(null, json); })
        .catch(function(err){ done(err); });
    } catch(err){
      done(err);
    }
  }

  // --- Apply config to shapes (color, link, label, a11y) ---
  function clearOldLabels(){
    var old = document.getElementById('labels-layer');
    if (old && old.parentNode) old.parentNode.removeChild(old);
  }

  function addLabel(el, text){
    if (!text) return;
    var bbox;
    try { bbox = el.getBBox(); } catch(e){ return; }
    if (!bbox) return;

    // Auto font-size based on smallest dimension; clamp to [6,18] px
    var smallest = Math.min(bbox.width, bbox.height);
    var size = Math.max(8, Math.min(22, Math.round(smallest * 0.6)));

    var g = document.getElementById('labels-layer');
    if (!g){
      g = document.createElementNS('http://www.w3.org/2000/svg','g');
      g.setAttribute('id','labels-layer');
      document.documentElement.appendChild(g);
    }
    var tx = document.createElementNS('http://www.w3.org/2000/svg','text');
    tx.setAttribute('class','label');
    tx.setAttribute('x', (bbox.x + bbox.width/2).toFixed(2));
    tx.setAttribute('y', (bbox.y + bbox.height/2).toFixed(2));
    tx.setAttribute('font-size', String(size));
    tx.textContent = String(text);
    g.appendChild(tx);
  }

  function makeClickable(el, href){
    // enable keyboard and click only if we really have a link
    el.classList.add('clickable');
    el.setAttribute('tabindex','0');
    el.setAttribute('role','button');
    el.setAttribute('data-href', href);
    el.setAttribute('aria-label', el.getAttribute('aria-label') || el.id);

    el.addEventListener('click', function(ev){
      var t = ev.currentTarget;
      var detail = { id: t.id, slug: t.getAttribute('data-slug') };
      try { t.dispatchEvent(new CustomEvent('boothclick', { bubbles: true, detail: detail })); } catch(e){}
      try { if (window && window.parent) { window.parent.postMessage({ type: 'boothclick', detail: detail }, '*'); } } catch(e){}
      if (href) { try { window.open(href, '_blank', 'noopener'); } catch(e){} }
    });

    el.addEventListener('keydown', function(ev){
      if (ev.key === 'Enter' || ev.key === ' ') {
        ev.preventDefault();
        ev.currentTarget.click();
      }
    });
  }

  function makeInactive(el){
    el.classList.remove('clickable');
    el.removeAttribute('tabindex');
    el.removeAttribute('role');
    el.removeAttribute('data-href');
    el.setAttribute('aria-label', el.id);
  }

  function applyConfig(cfg){
    if (!cfg) return;
    hydratePalette(cfg);
    var boothMap = getBoothMap(cfg);
    if (!boothMap) return;
    clearOldLabels();

    var nodes = document.querySelectorAll('[id]');
    for (var i=0; i<nodes.length; i++){
      var el = nodes[i];
      var id = el.id || '';
      if (!matchesPrefix(id)) continue;

      // slugging for possible external mapping
      var slug = slugify(id);
      el.setAttribute('data-slug', slug);

      var c = boothMap[id] || boothMap[slug]; // allow either exact id or slug keys
      if (!c) continue;

      // paint
      var fill = colorFor(c.category, c.status);
      el.style.fill = fill;

      // label
      // a11y: prefer human label for screenreaders
      if (c.label) { try { el.setAttribute('aria-label', String(c.label)); } catch(e){} }
      addLabel(el, c.label);

      // clickability
      var link = (c.book_link === '-' || c.status === 'inactive') ? null : c.book_link;
      if (link) { makeClickable(el, link); } else { makeInactive(el); }
    }
  }

  // --- Initialize: prime base a11y/tap affordances then paint via config ---
  (function baseWireUp(){
    var nodes = document.querySelectorAll('[id]');
    for (var i=0; i<nodes.length; i++){
      var el = nodes[i];
      var id = el.id || '';
      if (!matchesPrefix(id)) continue;
      var slug = slugify(id);
      el.setAttribute('data-slug', slug);
    }
  })();

  // Listen for parent -> SVG postMessage with config
  try {
    window.addEventListener('message', function(ev){
      var d = ev && ev.data;
      if (!d || typeof d !== 'object') return;
      if (d.type === 'VOID_MAP_CONFIG' && d.payload) {
        try { applyConfig(d.payload); } catch(e){}
      }
    }, false);
  } catch(e){}

  loadConfig(function(err, cfg){
    if (err) {
      // As a safe fallback, mark everything inactive gray so the map is still readable.
      var nodes = document.querySelectorAll('[id]');
      for (var i=0; i<nodes.length; i++){
        var el = nodes[i];
        if (!matchesPrefix(el.id || '')) continue;
        el.style.fill = COLOR_MAP.inactive.available;
        makeInactive(el);
      }
      return;
    }
    applyConfig(cfg);
  });
})();
